import octaLogo from "../media/logos/logo-octa.svg";

function Header() {
	return (
		<header id="Header" className="bg-black-500">
			<div className="grid grid-cols-12">
				<div className="cols-span-3">
					<img src={octaLogo} alt="" />
				</div>
			</div>
		</header>
	);
}

export default Header;
